svg.script:
var dn = {

  roll_handler: function(evt) {
    if (this.isChanging) {
      return false
    }
    this.isChanging = true
    //var tspan = this.querySelector('tspan')
    var tspan = this.querySelector('#tspan_numeric_value')
    var origOpacity = this.style.opacity

    dieMax = this.querySelector('#tspan_num_faces').textContent
    dieMax = parseInt(dieMax.substring(1))
    var newNum = randDiceString(1,dieMax)

    animated_ghost(this, { animation: 'rollOut' })
    tspan.textContent = ' '
    this.style.opacity = 0.1
    animated_ghost(this, {
      animation: 'rollIn',
      before_begin: (ghost) => {
        ghost.querySelector('g').style.opacity = origOpacity
      },
      on_done: () => {
        tspan.textContent = newNum
        this.style.opacity = origOpacity
        this.isChanging = false
        net_fire({type: "change", data: serialize(this)});
        evt_fire('change', this, null, {})
      },
    })
  },

  turn_handler: function(evt) {
    //console.log('dn ', this, 'turn!!!!!!!!!!!!!!!!!!!!!!!!!!!!', evt.detail)
    if (this.isChanging) {
      return false
    }
    this.isChanging = true
    var tspan = this.querySelector('#tspan_numeric_value')
    var origOpacity = this.style.opacity
    var origNum = parseInt(tspan.textContent)

    dieMax = this.querySelector('#tspan_num_faces').textContent
    dieMax = parseInt(dieMax.substring(1))

    animated_ghost(this, {
      animation: 'thumb',
      on_done: () => {
        tspan.textContent = (origNum % dieMax) + 1
        this.style.opacity = origOpacity
        this.isChanging = false
        net_fire({type: "change", data: serialize(this)});
        evt_fire('change', this, null, {})
      },
    })
    tspan.textContent = " "
    this.style.opacity = 0.1
  },

  initialize: function(elem, serializedState) {
    console.log('hooking up handlers for ', elem, serializedState)
    elem.addEventListener('die_roll', this.roll_handler)
    elem.addEventListener('dblclick', this.roll_handler)
    elem.addEventListener('die_turn_up', this.turn_handler)
    recordTspan = elem.querySelector('#tspan_num_faces')
    recordTspan.textContent = 'd' + serializedState['numFaces']

    showTspan = elem.querySelector('#tspan_numeric_value')
    showTspan.textContent = serializedState['numFaces']
  },

  menu: {
    'Roll': {
      eventName: 'die_roll',
      applicable: (dieNode) => { return true },
    },
    'Turn Up': {
      eventName: 'die_turn_up',
      applicable: (dieNode) => { return true },
      uiLabel: (dieNode) => { 
        var dieMax = dieNode.querySelector('#tspan_num_faces').textContent
        dieMax = parseInt(dieMax.substring(1))

        var tspan = dieNode.querySelector('#tspan_numeric_value')
        var nextNum = (parseInt(tspan.textContent) % dieMax) + 1
        return 'Turn to ' + nextNum
        },
    },
  },

  serialize: function(elem) {
    numFaces = elem.querySelector('#tspan_num_faces').textContent
    value = elem.querySelector('#tspan_numeric_value').textContent
    return {
      numFaces: numFaces,
      dieValue: value,
    }
  },

  deserialize: function(elem, payload) {
    elem.querySelector('#tspan_numeric_value').textContent = payload.numFaces
    elem.querySelector('#tspan_num_faces').textContent = payload.dieValue
  },

}
